import React, { Component } from "react";
import "./App.css";
import {Switch, Route} from 'react-router-dom'
import Homepage from './components/'

class App extends Component {
  state = {
    isSignedIn: false
  }

  render() {
    return (
      <Switch>
        <Route exact path="/" render={()=> <Homepage/>}/>
      </Switch>
    );
  }
}

export default App;
